Verenigde Staten
Horror / Actie

geregisseerd door Michael Roesch en Peter Scheerer
met Rick Yune, Lance Henriksen en Bill Moseley

De befaamde detective van paranormale en bovennatuurlijke zaken Edward Carnby (Rick Yune) is terug. Ditmaal moet Carnby proberen samen te werken met een speciaal team van heksenjagers. Samen proberen ze de levensgevaarlijke heks Elizabeth Dexter (Allison Lange) te pakken te krijgen. Maar dit is nog niet zo makkelijk als het in eerste instantie lijkt.



